# Structure for table "coursebox"
#

DROP TABLE IF EXISTS `coursebox`;
CREATE TABLE `coursebox` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` text COLLATE utf8_unicode_ci NOT NULL,
  `Description` text COLLATE utf8_unicode_ci,
  `PicUrl` text COLLATE utf8_unicode_ci,
  `CreateTime` datetime DEFAULT NULL,
  `LastUpdateTime` datetime DEFAULT NULL,
  `IsOpen` tinyint(1) DEFAULT NULL,
  `StartTime` datetime DEFAULT NULL,
  `EndTime` datetime DEFAULT NULL,
  `LikeNum` int(11) DEFAULT NULL,
  `DislikeNum` int(11) DEFAULT NULL,
  `CommentNum` int(11) DEFAULT NULL,
  `ShareNum` int(11) DEFAULT NULL,
  `CreatorId` int(11) DEFAULT NULL,
  `DeletedAt` datetime DEFAULT NULL,
  `IsDeleted` tinyint(1) NOT NULL,
  PRIMARY KEY (`ID`),
  KEY `IX_CreatorId` (`CreatorId`) USING HASH,
  CONSTRAINT `FK_CourseBox_UserInfo_CreatorId` FOREIGN KEY (`CreatorId`) REFERENCES `userinfo` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

