INSERT INTO `coursebox` VALUES (1,'高等数学（一）','高等数学是以微积分为主要内容的课程，它不但是理工类各专业，也是其他众多专业最重要的基础课程之一。我们的工作、科研以及生活中的很多例子，如：卫星成功驶进预定轨道，火车在弯道上飞驰而过，经济金融、天气预报和深海下潜，都与数学有着深深的联系。现在就让我们一起去高等数学的殿堂探索吧！',':WebUISite:/upload/images/courseBoxPics/1.jpeg','2019-10-20 21:01:06','2019-10-20 21:01:06',NULL,'2019-10-20 21:01:06','2020-05-20 21:01:06',NULL,NULL,NULL,NULL,1,NULL,0),(2,'Python语言程序设计 ','计算机是运算工具，更是创新平台，高效有趣地利用计算机需要更简洁实用的编程语言。Python简洁却强大、简单却专业，它是当今世界最受欢迎的编程语言，学好它终身受用。请跟随我们，学习并掌握Python语言，一起动起来，站在风口、享受创新！',':WebUISite:/upload/images/courseBoxPics/2.png','2019-10-21 21:01:06','2019-10-21 21:01:06',NULL,'2019-10-21 21:01:06','2020-05-21 21:01:06',NULL,NULL,NULL,NULL,1,'2019-10-21 08:27:42',1),(3,'沟通心理学','视角独特的“主持型”心理课，正能量的“烧脑”之旅。言语犀利，案例丰富，思维训练，实用性强，主讲人裴秋宇老师凝聚19年心理医生“心战”经历、15年世界五百强员工心理内训精华，获得2016最受欢迎慕课top1、2017十大最受欢迎国家精品在线课程。',':WebUISite:/upload/images/courseBoxPics/3.jpg','2019-10-22 21:01:06','2019-10-22 21:01:06',NULL,'2019-10-22 21:01:06','2020-05-22 21:01:06',NULL,NULL,NULL,NULL,1,NULL,0),(4,'程序设计入门——C语言','C语言是古老而长青的编程语言，它具备了现代程序设计的基础要求，它的语法是很多其他编程语言的基础，在系统程序、嵌入式系统等领域依然是无可替代的编程语言，在各类编程语言排行榜上常年占据前两名的位置。 本课程是零基础的编程入门课，是后续的操作系统、编译原理、体系结构等课程的基石。',':WebUISite:/upload/images/courseBoxPics/4.jpg','2019-10-23 21:01:06','2019-10-23 21:01:06',NULL,'2019-10-23 21:01:06','2020-05-23 21:01:06',NULL,NULL,NULL,NULL,1,NULL,0),(5,'金融学','本课程是金融专业统帅性基础理论课。   测试修改        教学资源丰富，教学理念先进，教学方法多元。采用宽口径的范畴，涵盖货币、信用、金融资产与价格、金融市场、金融机构、金融总量与均衡、调控与监管、金融发展等所有金融活动的集合。有利于认识金融原理，了解金融现状，掌握分析方法，培养解决金融问题的能力。',':WebUISite:/upload/images/courseBoxPics/5.jpg','2019-10-24 21:01:06','2019-10-21 08:22:04',NULL,'2019-10-24 00:00:00','2020-05-24 00:00:00',NULL,NULL,NULL,NULL,1,NULL,0),(6,'测试添加课程','测试添加课程描述',':WebUISite:/Upload/images/1/2019-10-21/764e230b-35ff-4b60-9694-3a5066e793d9.jpg','2019-10-21 08:23:21','2019-10-21 08:23:21',NULL,'2019-10-02 00:00:00','2019-11-15 00:00:00',NULL,NULL,NULL,NULL,1,NULL,0);

